import React from "react";
import "./Signup.css";
import {Link} from 'react-router-dom';
import { useState } from "react";
import MenuIcon from '@mui/icons-material/Menu';
function Signup() {
    const [isMenuOpen, setIsMenuOpen] = useState(false);
    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
      };
    const year = new Date().getFullYear();
    const [isActive,setisActive]=useState(false);
    return (
      <div>
        <div className="home-container">
            <div className="menu">
                <button className="menu-btn" onClick={toggleMenu}>
                    <MenuIcon/>
                </button>
                {isMenuOpen && (
                    <div className="dropdown">
                    <button className="menu-item">Contact</button>
                    <button className="menu-item">About Us</button>
                    </div>
                )}
            </div>
            <div className="tit">
                <h2><img src="/images/f3.png" alt=""/>FOOD NETWORK</h2>
            </div>
            <div className="buttons-container">
                <button className="log-btn">Login</button>
                <button className="sig-btn">Sign Up</button>
            </div>
        </div>
        <div className="sig-area">
            <h3 className="ye">Sign Up</h3>
            <div className="drop">
                <div className="d-btn" onClick={(e) => setisActive(!isActive)}>Choose one
                </div>
                {isActive &&(
                    <div className="d-con">
                        <div className="typ">Buyer
                        </div>
                        <div className="typ">Donor
                        </div>
                    </div>
                )}
            </div>
            <div>
                <input type="email" placeholder="Email"/>
            </div>
            <div>
                <input type="password" placeholder="Password"/>
            </div>
            <p className="ye">Already have an account?</p>
            <div>
                <Link to="\login">
                    <button>Sign up</button>
                </Link>
            </div>
        </div>




        <div className="footer1">
            <h3>Copyright ⓒ {year}</h3>
        </div>
      </div>
    );
  }
  
  export default Signup;
